function DataGen (options) {
	this.rootElements 	= 100;
	this.maxLevel 		= 1;
	this.maxChildren 	= 4;
	this.startIndex 	= 0;

	this.words = 'Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim. Donec pede justo, fringilla vel, aliquet nec, vulputate eget, arcu. In enim justo, rhoncus ut, imperdiet a, venenatis vitae, justo. Nullam dictum felis eu pede mollis pretium. Integer tincidunt. Cras dapibus. Vivamus elementum semper nisi. Aenean vulputate eleifend tellus. Aenean leo ligula, porttitor eu, consequat vitae, eleifend ac, enim. Aliquam lorem ante, dapibus in, viverra quis, feugiat a, tellus. Phasellus viverra nulla ut metus varius laoreet. Quisque rutrum. Aenean imperdiet. Etiam ultricies nisi vel augue. Curabitur ullamcorper ultricies nisi. Nam eget dui. Etiam rhoncus. Maecenas tempus, tellus eget condimentum rhoncus, sem quam semper libero, sit amet adipiscing sem neque sed ipsum. Nam quam nunc, blandit vel, luctus pulvinar, hendrerit id, lorem. Maecenas nec odio et ante tincidunt tempus. Donec vitae sapien ut libero venenatis faucibus. Nullam quis ante. Etiam sit amet orci eget eros faucibus tincidunt. Duis leo. Sed fringilla mauris sit amet nibh.'.split(' ');
	this.avatars = [
		'data:image/jpeg;base64,',
		'data:image/jpeg;base64,',
		'data:image/jpeg;base64,',
		'data:image/jpeg;base64,',
		'data:image/jpeg;base64,'
	];
	this.names = [
		'Harry Wijnvoord',
		'Mareike Amado',
		'Walter Freiwald',
		'Jochen Bendel',
		'Joerg Draeger'
	];
	return this.initialize(options);
}

DataGen.prototype = {
	initialize: function (options) {
		this._extend(this, options);
		return this;
	},

	_extend: function (destination, source, preventMutation) {
		destination = destination ||{};
		source 		= source ||{};

		var target 	= preventMutation
			? {}
			: destination;

		if (preventMutation) {
			for (var key in destination) {
				destination.hasOwnProperty(key)
					? target[key] = destination[key]
					: void(0);
			}
		}

		for (var key in source) {
			source.hasOwnProperty(key)
				? target[key] = source[key]
				: void(0);
		}

		return target;
	},

	generate: function (options) {
		options = this._extend(this, options, true);

		var data 				= [];
		var globalIdIterator	= options.startIndex;
		var lastUser 			= undefined;

		var generateNode = function (numLevelsLeft, parentNode, directId) {
			globalIdIterator++;

			var user = undefined;
			do {
				user = Math.round(Math.random() * (options.names.length - 1));
			} while (user === lastUser);
			lastUser = user;

			var numWordsText 	= Math.round(Math.random() * (options.words.length - 1) + 1);
			var wordsText 		= options.words.slice(0, numWordsText);
			var id 				= globalIdIterator;

			var node = {
				id: 		id,
				parent: 	parentNode,
				directId: 	directId,

				name: 		options.names[user],
				avatar: 	options.avatars[user],
				text: 		wordsText.join(' '),
				children:   []
			}

			if (numLevelsLeft > 0) {
				var numChildren = Math.round(Math.random() * options.maxChildren);
				numLevelsLeft--;
				while(--numChildren > 0) {
					node.children.push(generateNode(numLevelsLeft, node, node.children.length));
				}
			}

			return node;
		}


		while (--options.rootElements >= 0) {
			var numLevelsForNode 	= Math.round(Math.random() * options.maxLevel);
			var rootNode 			= generateNode(numLevelsForNode, undefined, data.length + options.startIndex);
			data.push(rootNode);
		}

		return data;
	}
}
